INSERT INTO `qs_pms` VALUES ('982','1','','0','3035','HFXZ123','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1377662140','1','1377662140','0');
INSERT INTO `qs_pms` VALUES ('983','1','','0','3036','lianbb','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1377662765','2','1377662765','0');
INSERT INTO `qs_pms` VALUES ('984','1','','0','3037','123ctt','温馨提醒\r\n注册成功后，登陆进入个人中心，请填写个人简历并完善个人资料。\r\n\r\n温馨提示：请填写真实有效的信息，方便企业查看您的简历后与您联系。同时，资料越详细，越容易被企业搜索到。\r\n\r\n简历与资料填写完后，即可在“找工作”、“招聘会”、“蓝领求职”等栏目中，搜索需要的岗位信息，并可在线投递简历。\r\n\r\n◆ 填写完整的简历，可以参与网站目前正在举办的有寅特尼抽奖活动，投简历，中大奖！\r\n\r\n使用完毕后，请点击网页最上方的“退出”，退出个人登录状态，以防他人冒用您的账号。\r\n\r\n 寅特尼人才网','1377668983','1','1377668983','0');
INSERT INTO `qs_pms` VALUES ('985','1','','0','3038','yxyl','所有注册企业请上传营业执照\r\n本着对网站求职者的负责，同时增加网站企业会员发布信息的公信力，网站设置会员注册后，必须上传营业执照，通过企业审核，方可发布招聘信息，否则发布信息一律无法显示。\r\n\r\n为什么要上传营业执照： ① 通过认证后您将获得更多权限；\r\n② 通过认证后可额外获得积分；\r\n③ 通过认证后可增加信息的可信度，成为已认证企业；\r\n注：上传营业执照仅供我们审核，绝不会用任何形式对外公开。','1377669888','1','1377669888','0');
